import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { ApprovePayrollNewComponent } from '../approve-payroll-new/approve-payroll-new.component';
import { ApprovePayrollAmendComponent } from '../approve-payroll-amend/approve-payroll-amend.component';

const approvalRoute: Routes = [
    {
        path: 'approve-new/:id',
        component: ApprovePayrollNewComponent,
        data: {
            defaultSort: 'id,asc'
        },
        canActivate: [UserRouteAccessService]
    },
    {
        path: 'approve-amend/:id',
        component: ApprovePayrollAmendComponent,
        data: {
            defaultSort: 'id,asc'
        },
        canActivate: [UserRouteAccessService]
    }
];

@NgModule({
    imports: [RouterModule.forChild(approvalRoute)],
    exports: [RouterModule]
})
export class ApprovalRoutingModule {
}
